(5, 'Дөрвөн улирлын Амины орон сууц', NULL, '', 1550000.00, '', '', '[]', '👉Байшин захиалга бүр бэлэгтэй.\r\n   👷‍♂️Манай компани таны хүссэн хэмжээ загвараар  4н улирлын Амины орон сууцыг барьж хүлээлгэн өгнө.\r\n✔️Үнэ. КАНАД БАЙШИН 1м2 -1.550.000 төгрөг \r\n              бетон суурь багтсан \r\n✅Үнэ 1м2 -  1.800.000 төгрөг \r\n         цэвэр бохир Орсон халаалт Орсон бетон суурь Орсон\r\nХамтрагч байгууллагууд.\r\nАНУ  Johns Manville  дулаалга \r\nMarch Design  3 Давхар вакум цонх\r\nRostorg.mn - Росторг ХХК  МЕТАЛЛ ДЭЭВЭР\r\nZebra SIP haus  ГАДНА ФАСАТ \r\nKOREA CABLE Шалны Халаалт \r\nАгааржуулагч Осак \r\n👍Мөн манайх Гачуурт -д. 8 айлын хотхондоо цөөхөн захиалга авч байна.    \r\n       💁‍♂️хотхонд. 70м2 байшин 126 Сая\r\n            Бэлэн байшин 70м2  135сая', 'Улаанбаатар', 'Зуслангийн Байшин Констракшн ххк', '+97699001482', 'zuslangiinbaishin@gmail.com', 7, 'c3_493', 13, 1, '2023-07-11 03:15:17', 20, 1, 4, NULL),
(7, 'FJ CRUISER (GSJ15L)', NULL, '', 99000000.00, '', '', '[{&quot;Мотор багтаамж&quot;:&quot;4000 cc&quot;},{&quot;Хурдны хайрцаг&quot;:&quot;&quot;},{&quot;Хүрд&quot;:&quot;Зөв&quot;},{&quot;Төрөл&quot;:&quot;&quot;},{&quot;Өнгө&quot;:&quot;Шаргал&quot;},{&quot;Үйлдвэрлэсэн он&quot;:&quot;2007 &quot;},{&quot;Орж ирсэн он&quot;:&quot;2023 &quot;},{&quot;Хөдөлгүүр&quot;:&quot;Бензин&quot;},{&quot;Дотор өнгө&quot;:&quot;Хар&quot;},{&quot;Лизинг&quot;:&quot;&quot;},{&quot;Хөтлөгч&quot;:&quot;&quot;},{&quot;Явсан&quot;:&quot;100.000 км&quot;},{&quot;Нөхцөл&quot;:&quot;&quot;},{&quot;Хаалга&quot;:&quot;4&quot;}]', '#БҮХ_БАНКНЫ_ЛИЗИНГТЭЙ\r\n#ББСБ_ЛИЗИНГ\r\n#МАШИН_ОРОЛЦУУЛНА\r\n#НӨАТын_БАРИМТТАЙ\r\nGSJ15L Toyota FJ Cruiser Шаргал:\r\n- 2007 оны 07 сард үйлдвэрлэсэн\r\n- 2023 оны 01 cарын 13-нд буусан\r\n- 3.5B үнэлгээ, 100.000 км гүйлттэй\r\n- 4000cc, 1GR V6 бензин хөдөлгүүртэй\r\n- Залгаж салгадаг мосттой\r\n#ҮНЭ: 99 сая\r\n- Шаргал өнгөтэй\r\n- Хар салонтой\r\n- Зөв жолооны хүрдтэй\r\n- Японоос орж ирсэн\r\n- Мөнххада дээр бүх шингэн сольсон\r\n/мотор, кроп, туслах, редуктор, гидр, тормосын бүх шингэн/\r\n- Мөнххада дээр явах ангийн бүх втулк, тормосны аппарат сольсон\r\n- Мөнххада дээр солигдсон бүх сэлбэг OEM\r\n- ARB Mongolia-д Old Man Emu пүрш, амортизатор, урд гар, амортизаторын таваг сольсон\r\n- BFGoodrich KM3 285/75R17 brand new дугуй\r\n- Spain-аас ирсэн /5bogd, braid-c биш/ braid wheel +7m\r\n- Patriot тавцан ачаа шинэ\r\n- Урдаа, хажуудаа камер, хар хайрцагтай\r\n- Ухрах камер\r\n- Гадна болон салон маш цэвэрхэн\r\n- Only orignal уриатай тоноглосон 30-50ккм зөвхөн бензин, моторын тос солихоос өөр хийх зүйлгүй\r\n- Бүх деталь үйлдвэрийн будгаараа, ямар ч сэв зураасгүй, бодит гүйлттэй, маш цэвэрхэн, туулах чадвар сайтай, загварлаг, хийх ёстой бүх зүйлийг хийсэн, аялалд бэлэн маш сайн Toyota FJ Cruiser GSJ15L зарна.\r\n- ТӨЛБӨРИЙН НӨХЦӨЛ:\r\n👍Банк (Урьд 20%, хүү: 1.6-1.8%, хугацаа 30 сар)\r\n👍ББСБ (урьд 20-40%, хүү 2.3-2.9%, хугацаа 48 сар)\r\n👍Trade in (Унаж байгаа машинаа урьдчилгаанд оролцуулж болно)\r\nЖич: Монголд үйл ажиллагаа явуулж байгаа бүх банкны зээлээр авах боломжтой.', 'Улаанбаатар', 'Sain Motors', '+97677117736', '', 8, 'c4_309', 4, 0, '2023-07-11 06:08:17', 30, 0, 4, NULL),
